function onTick() --map data zoom = input.getNumber(1) x = input.getNumber(2) y = input.getNumber(3) --colours r = input.getNumber(4) g = input.getNumber(5) b = input.getNumber(6) a = input.getNumber(7)
end
function onDraw() w = screen.getWidth() --x h = screen.getHeight() --y screen.setColor(r, g, b, a) screen.drawMap(x,y,zoom) screen.drawText(1,h-12,"X:"..( math.floor((x*100)+0.5)/100 ) ) screen.drawText(1,h-6,"Y:"..( math.floor((y*100)+0.5)/100 ) ) end

function math.Clamp(val, lower, upper)
    if lower > upper then lower, upper = upper, lower end -- swap if boundaries supplied the wrong way
    return math.max(lower, math.min(upper, val))
end

size = property.getNumber("Size");
centerMarkerSize = property.getNumber("Center Marker Size");
range = property.getNumber("Range");
minDistance = property.getNumber("Min Distance");
lifetime = property.getNumber("Dot Lifetime");
dotAlpha = property.getNumber("Dot Alpha");
rotOffset = property.getNumber("Rotation Offset")-90;
connectDistance = property.getNumber("Connect Distance");
connectNearby = property.getBool("Connect Nearby");

lastDotPos = {x=0,y=0}

lidar = false;

if property.getNumber("Mode") == 1 then
	lidar = true;
end

lidarScanColor = {255, 0, 0,255}
radarScanColor = {0, 255, 0,50}
playerMarkerColor = {255,0,0,255}

dots = {};
dr = 0.0174532925;

r = 0;
d = 0;
t = 0;

function onTick()
	d = input.getNumber(1);
	r = (input.getNumber(2)%1)*6.2831853072;
	t = t+1;

	if d < range and d >= minDistance then
		local a = true;
		local x=math.floor(((d*size/2/range)*math.cos(r+dr*rotOffset)+size/2)+0.5);
		local y=math.floor(((d*size/2/range)*math.sin(r+dr*rotOffset)+size/2)+0.5);
		for k, v in pairs(dots) do
			if v.x == x and v.y == y then
				v.t = t;
				a = false;
				break;
			end
		end
		if a == true then
			dots[#dots+1] = {x=x, y=y, t=t};
		end
	end
end

function onDraw()
	w = screen.getWidth();
	h = screen.getHeight();
	screen.setColor(0, 0, 0);
	--screen.drawRectF(0,0,size,size);

	for k, v in pairs(dots) do
		local l = (lifetime-(t-v.t))/lifetime;
		if l <= 0 then
			dots[k] = nil;
		else
			screen.setColor(0, 255, 0, l*dotAlpha);
 	   	screen.drawRectF(v.x,v.y,1,1);
			if connectNearby == true then
				if math.sqrt((v.x-lastDotPos.x)*(v.x-lastDotPos.x)+(v.y-lastDotPos.y)*(v.y-lastDotPos.y)) < connectDistance then
					screen.setColor(0, 255, 0, dotAlpha);
					screen.drawLine(v.x,v.y,lastDotPos.x,lastDotPos.y);
				end
				lastDotPos = {x=v.x,y=v.y};
			end			
		end
	end

	local c;
	local x;
	local y;
	if lidar == true then
		c = lidarScanColor;
		x = math.floor(((math.min(d, range)*size/2/range)*math.cos(r+dr*rotOffset)+size/2)+0.5);
		y = math.floor(((math.min(d, range)*size/2/range)*math.sin(r+dr*rotOffset)+size/2)+0.5);
	else
		c = radarScanColor;
		x = math.floor(((size/2)*math.cos(r+dr*rotOffset)+size/2)+0.5);
		y = math.floor(((size/2)*math.sin(r+dr*rotOffset)+size/2)+0.5);;
	end
	screen.setColor(c[1],c[2],c[3],c[4]);
	screen.drawLine(size/2,size/2,x,y);
	screen.setColor(playerMarkerColor[1],playerMarkerColor[2],playerMarkerColor[3],playerMarkerColor[4]);
	screen.drawRectF(size/2,size/2,centerMarkerSize,centerMarkerSize);
end
